private DetailAST getMethodIdentAst() {
    DetailAST ast = getMainAst();
    if (ast.getType() != TokenTypes.SUPER_CTOR_CALL) {
        ast = ast.getFirstChild();
        if (ast.getType() == TokenTypes.DOT) {
            ast = ast.getLastChild();
        }
    }
    return ast;
}
